April Adams, Felecia, Laura Palmer, Rebecca Wild, Sandi Beach, Shonna Lynn, Sindee Coxx, Whitney Wonders

It's an All Girl Wrestling Special! Those Lovely Ladies are at it again! This time they're exploring the fine art of close contact sport. There'll be Oil Wrestling, Cat Fights, Hand to Hand Combat, not to mention a grueling session in the tanning salon. So roll out the mat and join April, Felecia and the rest of the gals in a no holds barred grudge match to the end!
